import dynamic from "next/dynamic";
const Layout = dynamic(import("../components/Layout"));

const Homepage = (props) =>  {
  return (
  <Layout>
    <div className="main">
      <br/><br/><br/><br/>
      <h1 className={styles.slogan+ " center"}>
